import React from 'react';
import { Expense, Category } from '../types'; // Importing the interfaces
import ExpenseForm from './ExpenseForm';

interface ExpenseProps {
  expenses: Expense[];
  setExpenses: React.Dispatch<React.SetStateAction<Expense[]>>;
  categories: Category[];
}

const Expenses: React.FC<ExpenseProps> = ({ expenses, setExpenses, categories }) => {
  return (
    <div>
      <h2>Expenses</h2>
      <ExpenseForm setExpenses={setExpenses} categories={categories} />
      <table>
        <thead>
          <tr>
            <th>Description</th>
            <th>Amount</th>
            <th>Date</th>
            <th>Category</th>
          </tr>
        </thead>
        <tbody>
          {expenses.map(expense => (
            <tr key={expense.ExpenseID}>
              <td>{expense.Description}</td>
              <td>{expense.Amount}</td>
              <td>{expense.Date}</td>
              <td>{expense.CategoryName}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Expenses;
